/* @jsx mdx */
  import React from 'react'
  import { mdx } from '@mdx-js/react'
  /* @jsx mdx */
import { Playground, Props } from 'docz'
import Img from '../Img/Img'
import styled from 'styled-components'
import { ThemeProvider } from '../ThemeContext'

const makeShortcode = name => function MDXDefaultShortcode(props) {
  console.warn("Component " + name + " was not imported, exported, or provided by MDXProvider as global scope")
  return <div {...props}/>
};

const layoutProps = {

};
const MDXLayout = "wrapper"
export default function MDXContent({
  components,
  ...props
}) {
  return <MDXLayout {...layoutProps} {...props} components={components} mdxType="MDXLayout">

    <h1 {...{
      "id": "img"
    }}>{`Img`}</h1>
    <h2 {...{
      "id": "properties"
    }}>{`Properties`}</h2>
    <Props of={Img} mdxType="Props" />
    <h2 {...{
      "id": "default"
    }}>{`Default`}</h2>
    <Playground __position={1} __code={'<ThemeProvider>\n  <Img\n    width=\"640px\"\n    height=\"480px\"\n    src=\"https://images.unsplash.com/photo-1552581234-26160f608093?ixlib=rb-1.2.1&ixid=eyJhcHBfaWQiOjEyMDd9&auto=format&fit=crop&w=1050&q=80\"\n  />\n</ThemeProvider>'} __scope={{
      props: this ? this.props : props,
      Playground,
      Props,
      Img,
